import {useActions} from "./useActions";
import {useEffect} from "react";
import axios from "axios";
import {IWeather} from "../redux/reducers/weatherReducer";

export const useFetchWeather = () => {
    const {fetchWeater} = useActions()
    useEffect(() => {
        axios.get<IWeather>('https://weather.visualcrossing.com/VisualCrossingWebServices/rest/services/timeline/kyiv?unitGroup=metric&key=KXLCQFR4Q8PKE8LW86YXF7QWD&contentType=json').then(res => fetchWeater(res.data));
    }, []);
}
